      times = i.split("-")
      start = DateTime.parse(times[0])
      if times.length==2
        en = DateTime.parse(times[1])
        eh["E"] = en
      end
      eh["S"] = start
    when "L"
      if i != ""
        place = Place.where(:name => i).first
        if place.nil?
          place = Place.create(:name => i)
        end
        eh["P"] = place.id
      else
        eh["P"] = nil
      end
    end
  end
  e = Event.new(:name => eh["N"], :start => eh["S"], :end => eh["E"], :other => eh["O"], :date => eh["D"])
  unless eh["P"].nil?
    p = Place.where(:id => eh["P"]).first
    e.place = p
  end
  e.save

end